Description
The economy may have crashed, but the high stakes world of real estate has never been hotter! Meet the semen siphoning sales team willing to close the deal by all means necessary! Bad credit? Don't worry - they'll bend over backwards to give you a perfect score! They're up against the wall (and on their knees...) desperate to get you inside -and not just their homes!
